import { useSelector } from "react-redux";
import {Table} from 'react-bootstrap'
const Worker = () => {
    
    const id = useSelector(state => state.dataw.worker) 
console.log(id)
    return (
        <div>
            <Table>
                <tr> {id._id}</tr>
                <tr> {id.fName}</tr>
                <tr> {id.phoneNumber}</tr>
                <tr> {id.age}</tr>
                <tr> {id.email}</tr>
                </Table>
        </div>
    )
}

export default Worker
